import React, { useState } from 'react';
import { Form, Formik, Field } from 'formik';
import MuiGrid from '@material-ui/core/Grid';
import { Paper } from '@material-ui/core';
import Styles from './Styles';
import {
  CARD_ITEMS,
  CATEGORY_ITEMS,
  CATEGORY_ITEMS_TWO,
  CATEGORY_ITEMS_THREE,
} from './Constants';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import styled from '@material-ui/styles/styled';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import { useIntl } from 'react-intl';
import Box from '@material-ui/core/Box';
import {
  compose as composeStyles,
  palette,
  sizing,
  spacing,
} from '@material-ui/system';
import { MyTextField } from '../Common/TextField';
const Grid = styled(MuiGrid)(composeStyles(spacing, palette, sizing));

interface Values {
  userName: string;
  password: string;
  emailAddress: string;
}

interface Props {
  onSubmit: (values: Values) => void;
}

interface TabPanelProps {
  children?: React.ReactNode;
  index: any;
  value: any;
}

function Contents(props: Props) {
  const classes = Styles();
  const [value, setValue] = useState(0);
  const intl = useIntl();
  const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
    setValue(newValue);
  };

  function TabPanel(props: TabPanelProps) {
    const { children, value, index, ...other } = props;

    return (
      <Grid hidden={value !== index} id={`simple-tabpanel-${index}`} {...other}>
        {value === index && <Box>{children}</Box>}
      </Grid>
    );
  }
  function a11yProps(index: any) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
  }

  const onSubmit = (values: object) => {};

  return (
    <React.Fragment>
      <Grid px={4} container className={classes.carouselStyles}>
        <Grid item md={7}></Grid>
        <Grid item md={4} py={8} px={5}>
          <Paper>
            <Formik
              initialValues={{ password: '', emailAddress: '', userName: '' }}
              onSubmit={(values) => {
                onSubmit(values);
              }}
            >
              {({ values, handleChange, handleBlur }) => (
                <Form>
                  <Grid pb={1}>
                    <Field
                      component={MyTextField}
                      name="emailAddress"
                      label="Email Address"
                      placeholder="Email Address"
                      size="small"
                    />
                  </Grid>
                  <Grid pb={1}>
                    <Field
                      component={MyTextField}
                      name="password"
                      label="Password"
                      placeholder="Password"
                      type="password"
                    />
                  </Grid>
                  <Grid pb={1}>
                    <Button
                      fullWidth
                      size="large"
                      type="submit"
                      variant="contained"
                      color="primary"
                    >
                      {intl.formatMessage({ id: 'login' })}
                    </Button>
                  </Grid>
                </Form>
              )}
            </Formik>
          </Paper>
        </Grid>
      </Grid>

      <Grid container px={5} py={3} spacing={4}>
        {CARD_ITEMS.map((item) => (
          <Grid item md={4}>
            <Card className={classes.paperImg}>
              <CardMedia
                component="img"
                alt="Contemplative Reptile"
                height="140"
                image={item.imgSrc}
                title="Contemplative Reptile"
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                  {intl.formatMessage({ id: item.title })}
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                  {intl.formatMessage({ id: item.description })}
                </Typography>
              </CardContent>
              <CardActions>
                <Button size="small">
                  {intl.formatMessage({ id: 'find_out_more' })}
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
      <Grid container px={5} py={3}>
        <Grid item md={12}>
          <Typography variant="h6" align="center">
            {intl.formatMessage({ id: 'shop_by_category' })}
          </Typography>
          <Grid
            item
            md={12}
            py={3}
            justify="center"
            className={classes.categoryClass}
          >
            <Tabs
              value={value}
              onChange={handleChange}
              aria-label="simple tabs example"
            >
              <Tab label="Accessories" {...a11yProps(0)} />
              <Tab label="Foods" {...a11yProps(1)} />
              <Tab label="Vitamins" {...a11yProps(2)} />
            </Tabs>
          </Grid>
        </Grid>
        <TabPanel value={value} index={0}>
          <Grid container spacing={3} px={5}>
            {CATEGORY_ITEMS.map((item) => (
              <Grid item md={3}>
                <Card>
                  <CardMedia
                    component="img"
                    height="140"
                    image={item.imgSrc}
                    title={item.title}
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="h2">
                      {item.title}
                    </Typography>
                    <Typography
                      variant="body2"
                      color="textSecondary"
                      component="p"
                    >
                      {item.description}
                    </Typography>
                  </CardContent>
                  <CardActions className={classes.cardActionStyles}>
                    <Button size="large">
                      {intl.formatMessage({ id: 'view' })}
                    </Button>
                    <Button size="large">
